import dpSeries from "./eventposter/dpSeries.jpeg";
import  bgEvent from "./Images/bgEvent.jpeg";
import decode from "./Images/decode.jpeg";
import grpimg from "./Images/grpimg.jpg";
import ias from "./Images/IeeeAndSairamLogo.png"

const images = [
    dpSeries,
    bgEvent,
    decode,
    grpimg,
    ias,
]

export default images;
